import { TextInput } from "@mantine/core";
import React, { useState } from "react";
import { useForm } from "react-hook-form";
import styled from "styled-components";
import DropFilezone from "../../shared/DropFilezone";

const UserModal = () => {
  const testImg =
    "data:image/jpeg;base64,";

  // states
  const [img, setImg] = useState(testImg);

  // hook form
  const { register, handleSubmit } = useForm();

  const defaultValues = {
    fullName: "Mr. Ab Barik",
    email: "ab@gmail.com",
    phone: "+880 1777 888547",
  };

  const onSubmit = (data) => {
    data.img = img;

    // validate
    if (data.img === "") {
      alert("please insert images");
    } else {
      console.log(data);
    }
  };

  return (
    <Container>
      <form onSubmit={handleSubmit(onSubmit)}>
        <CustomInput>
          <p>
            Image <span>*</span>
          </p>
          <DropFilezone
            fileState={img}
            setFileState={setImg}
            acceptedFiles={{
              "image/jpeg": [".jpeg"],
              "image/png": [".png"],
            }}
            maxNumber={1}
          />
        </CustomInput>

        <TextInput
          defaultValue={defaultValues.fullName}
          {...register("name", { required: true })}
          placeholder="Full Name"
          label="Name"
          withAsterisk
        />
        <TextInput
          defaultValue={defaultValues.email}
          {...register("email", { required: true })}
          type="email"
          placeholder="Email"
          label="Email"
          withAsterisk
        />
        <TextInput
          defaultValue={defaultValues.phone}
          {...register("phone", { required: true })}
          placeholder="Phone"
          label="Phone"
          withAsterisk
        />

        <Upload disabled={false}>UPDATE</Upload>
      </form>
    </Container>
  );
};

export default UserModal;

const Container = styled.div``;

const CustomInput = styled.div`
  font-family: -apple-system, BlinkMacSystemFont, Segoe UI, Roboto, Helvetica,
    Arial, sans-serif, Apple Color Emoji, Segoe UI Emoji;
  font-weight: 500;
  font-size: 15px;
  color: #212529;

  span {
    color: red;
  }
`;

const Upload = styled.button`
  width: 100%;
  background: ${(props) => (props?.disabled ? "gray" : "#3d69e1")};
  color: white;
  padding: 10px;
  text-align: center;
  font-family: -apple-system, BlinkMacSystemFont, Segoe UI, Roboto, Helvetica,
    Arial, sans-serif, Apple Color Emoji, Segoe UI Emoji;
  border-radius: 4px;
  outline: none;
  border: none;
  cursor: pointer;
  margin-bottom: 10px;
  margin-top: 15px;
`;
